values:
&quot;i guess we both changed in ways we didn't think we would&quot;
i'm moving out of student housing soon
good and bad
do i like where i'm going?&nbsp;

&nbsp;there's so many things that i want and i don't know how to get them i have so many things going well for me but so many things falling around me as well and so much death this week everythings mixed together this person i want to be isn't real and these places i want to go are false as well i just find dissapointments even though the real disapointment is probably in myself&nbsp;
i know i'm just kidding myself
but what else can i do
nothing works the way its supposed to and we've ruined everything i'd rather be unemployed than continue working where i was but suddenly my busy life of school and work and boyfriend are replaced with sitting and thinking and nothing and nothing and trying to find things to do but not having the money to do them so i'll just sit and wait but i'm tired of waiting for life to start "life started when you where born"&nbsp;
i'll have it figured out someday, more like somedayS and other days, not so much

&nbsp;no job, nothing to do,
not much money to spend
my heart,&nbsp;
missing?&nbsp;
i just wish more than anything,&nbsp;
that the next month would go by
quickly, please

&nbsp;i've realized that it's basically impossible to find good people, true friends,
but i'm so thankful for the few i've found
i've missed my friends,&nbsp;
